io pecuario que posee un corral para el manejo animal y brindar bienestar animal provisto de brete y bascula',1),(14,'ELABORACION DE SUPLEMENTOS ALIMENTICIO','G14','Predio pecuario en la cual se elaboran suplementos alimenticios como lo son bloques nutricionales, ensilaje, sales mineralizadas, concentrados, etc. Para la alimentaciГіn y suplementación animal',1),(15,'PROGRAMAS DE REPRODUCCION ANIMAL IATF','G15','Predio pecuario en el cual se realizas prácticas. De reproducción animal como son inseminación artificial a tiempo fijo, transferencia de embriones, evaluaciГіn andrológica y ginecológica y elaboración de pajillas',1),(16,'ESTAR CERTIFICADO BPG','G16','Predio pecuario que cuenta con el certificado de BPG',1),(17,'SIN GALPON','A1','Predio pecuario el cual no cuenta con un galpón para realizar la actividad de cría de aves postura o de engorde',2),(18,'CON GALPON','A2','Predio pecuario cuenta con un galpón para la realización de la cría de aves de postura o de engorde',2),(19,'CON GALPON FUNCIONAL','A3','Sin descripción',2),(20,'CON BEBEDEROS Y COMEDEROS','A4','Predio pecuario que cuenta con galpГіn y dentro de su infraestructura cuenta con bebederos y comederos para la cría de aves',2),(21,'CON ESQUEMA DE BIOSEGURIDAD','A5','Predio pecuario que tiene como actividad la avicultura y que cuenta con un esquema de bioseguridad para prevenir la entrada de enfermedades dentro de la granja',2),(22,'CON BODEGA','A6','Predio pecuario que cuenta con una bodega para la conservación de forma correcta del concentrado, almacenamiento y clasificación del producto avícola',2),(23,'CON CLASIFICADORA DE HUEVO','A7','Predio pecuario que dentro de su s equipo cuenta con una clasificadora de huevos por peso',2),(24,'CON BENEFICIADERO DE AVES','A8','Predio pecuario que dentro de su infraestructura cuenta con un beneficiadero de aves de engorde',2),(25,'CON CERTIFICACION GAB DEL ICA','A9','Predio pecuario que cuenta con el certificado de GRANJA AVICOLA BIOSEGURA GAB. Entregada por el 